local function makeDraggableFast(frame, handles)
	local dragging, offset = false, Vector2.new(0, 0);
	local moveConn, endConn;
	local function beginDrag()
		dragging = true;
		local mPos = Services.UserInputService:GetMouseLocation();
		local inset = Services.GuiService:GetGuiInset();
		offset = mPos - (frame.AbsolutePosition + inset);
		if moveConn then
			moveConn:Disconnect();
		end
		if endConn then
			endConn:Disconnect();
		end
		moveConn = Services.UserInputService.InputChanged:Connect(function(inp)
			if (dragging and ((inp.UserInputType == Enum.UserInputType.MouseMovement) or (inp.UserInputType == Enum.UserInputType.Touch))) then
				local curMouse = Services.UserInputService:GetMouseLocation();
				frame.Position = UDim2.fromOffset(curMouse.X - offset.X, curMouse.Y - offset.Y);
			end
		end);
		endConn = Services.UserInputService.InputEnded:Connect(function(inp)
			if ((inp.UserInputType == Enum.UserInputType.MouseButton1) or (inp.UserInputType == Enum.UserInputType.Touch)) then
				dragging = false;
				if moveConn then
					moveConn:Disconnect();
				end
				if endConn then
					endConn:Disconnect();
				end
			end
		end);
	end
	for _, h in ipairs(handles) do
		h.InputBegan:Connect(function(input)
			if ((input.UserInputType == Enum.UserInputType.MouseButton1) or (input.UserInputType == Enum.UserInputType.Touch)) then
				beginDrag();
			end
		end);
	end
end
