local function applyFontSizeAll()
	State.currentFontSize = clamp(State.currentFontSize, Config.MIN_FONT_SIZE, Config.MAX_FONT_SIZE);
	for _, e in ipairs(State.entries) do
		if (e.node and e.node.Parent) then
			e.node.TextSize = State.currentFontSize;
		end
		if (e.translationNode and e.translationNode.Parent) then
			e.translationNode.TextSize = State.currentFontSize - 1;
		end
		if (e.langNode and e.langNode.Parent) then
			e.langNode.TextSize = State.currentFontSize - 2;
		end
	end
end
local function pruneIfNeeded()
	while #State.logLines > Config.MAX_LINES do
		table.remove(State.logLines, 1);
		if (State.entries[1] and State.entries[1].container) then
			State.entries[1].container:Destroy();
		end
		table.remove(State.entries, 1);
	end
	updateCounters();
end
