local function addResizeGrip(targetFrame, minW, minH)
	if targetFrame:FindFirstChild(LUAOBFUSACTOR_DECRYPT_STR_0("\176\87\72\115\201\254\122\68\139\66", "\54\226\50\59\26\179\155\61")) then
		targetFrame.ResizeGrip:Destroy();
