	if targetFrame:FindFirstChild(LUAOBFUSACTOR_DECRYPT_STR_0("\236\9\7\127\13\195\46", "\127\170\94\88\56")) then
		targetFrame:FindFirstChild(LUAOBFUSACTOR_DECRYPT_STR_0("\198\240\139\229\170\52\233", "\198\128\167\212\162\216\93\153")):Destroy();
	end
	local grip = Instance.new(LUAOBFUSACTOR_DECRYPT_STR_0("\140\40\229\211\175", "\190\202\90\132"));
	grip.Name = LUAOBFUSACTOR_DECRYPT_STR_0("\181\220\96\222\184\35\160\203\122\199", "\70\231\185\19\183\194");
	grip.Parent = targetFrame;
	grip.AnchorPoint = Vector2.new(1, 1);
	grip.Position = UDim2.new(1, -2, 1, -2);
	grip.Size = UDim2.new(0, 12, 0, 12);
	grip.BackgroundColor3 = Color3.fromRGB(180, 180, 180);
	grip.BorderSizePixel = 0;
	grip.ZIndex = 20;
	Instance.new(LUAOBFUSACTOR_DECRYPT_STR_0("\238\233\199\171\161\213\197\246", "\211\187\160\132\196"), grip).CornerRadius = UDim.new(0, 3);
	grip.InputBegan:Connect(function(input)
		if (input.UserInputType == Enum.UserInputType.MouseButton1) then
			State.isResizing = true;
			State.resizingTarget = targetFrame;
			State.resizeMinW = minW or 200;
			State.resizeMinH = minH or 200;
			State.startMouse = Services.UserInputService:GetMouseLocation();
			State.startSize = targetFrame.AbsoluteSize;
		end
	end);
	return grip;
end
