Services.UserInputService.InputChanged:Connect(function(input)
	if (State.isResizing and State.resizingTarget and (input.UserInputType == Enum.UserInputType.MouseMovement)) then
		local currMouse = Services.UserInputService:GetMouseLocation();
		local delta = currMouse - State.startMouse;
		local newX = math.max(State.resizeMinW, State.startSize.X + delta.X);
		local newY = math.max(State.resizeMinH, State.startSize.Y + delta.Y);
		State.resizingTarget.Size = UDim2.fromOffset(newX, newY);
		if (State.resizingTarget == UI.Container) then
			GlobalConfig.windowSize.X = newX;
			GlobalConfig.windowSize.Y = newY;
		end
	end
end);
Services.UserInputService.InputEnded:Connect(function(input)
	if (input.UserInputType == Enum.UserInputType.MouseButton1) then
		if State.isResizing then
			State.isResizing = false;
			State.resizingTarget = nil;
